import React from 'react';

const BlogCard = () => {
  return (
    <div className="col-3">
    <div className="blog-card">
        <div className="card-image">
           <img src="images/blog-1.jpg" className="img-fluid" alt="blog" />
            </div> 
            </div>
    </div>
  );
};

export default BlogCard
